export const Home = (props) => {
    return (
        <>
            <div className="d-flex justify-content-center align-items-center" style={{height: 800+"px"}}>
                <div className="bg-primary">
                    &nbsp;
                </div>
                <div className="bg-secondary">
                    &nbsp;
                </div>
                <div className="bg-danger">
                    &nbsp;
                </div>
            </div>

        </>
    )
}
